import React from 'react'
import Card from './Card'

class MyPlans extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            plans: []
        }
    }

    componentDidMount() {
        fetch("http://localhost:5000/users/5e69b32167dbfb1157c1becf/myplans")
            .then(res => res.json())
            .then(plans => {
                this.setState({
                    plans: plans
                })
            })
            .catch(err => console.log(err))
    }

    genPlanCards() {
        for (let i = 0; i < this.state.plans.length; i++) {
            console.log(this.state.plans[i])
        }
    }

    render() {
        return (
            <div>
                <div className="container mt-3">
                    <h3 className="text-left">Here are your active plans:</h3>
                    <div className="row">
                        {this.genPlanCards()}
                    </div>
                </div>
            </div>
        )
    }
}

export default MyPlans
